    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,645.6332)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text122"><tspan
         x="0 5.0040002 10.008 12.762 18.261 20.763 25.767 29.268 34.766998 39.771 43.271999 46.026001 51.029999 54.530998 58.032001 63.035999 66.537003 70.038002 75.042 80.541 83.042999 88.046997 90.801003 94.302002 96.804001 99.306 104.805 109.305 114.804 119.808 123.309 126.063 130.563 133.065 135.819 139.32001 142.821 147.321 152.82001 158.319 163.323 166.077 169.578 174.582 182.58299 190.584 195.588 198.261 200.763 203.517 210.015 215.019 218.52 221.274 226.278 231.282 236.78101 239.535 242.037 244.539 249.039 254.043 257.54401 260.298 265.797 271.29599 274.797 280.29599 282.798 288.297 293.30099 296.05499 299.556 302.05801 307.55701 310.311 312.81299 315.56699 320.57101 324.07199 326.82599 330.327 338.328 340.82999 343.332 348.336 351.83701 355.33801 360.34201 365.34601 370.845 373.34698 376.10101 381.60001 386.10001 391.599 395.10001 397.854 402.354 404.85599 407.60999 413.10901 418.11301 421.61401 424.36801 429.37201 434.871 438.37201 442.87201 447.87601 451.37701 454.13101 457.63199 463.13101 466.63199 469.38599 474.88501 477.38699 482.88599 487.89001 493.38901"
         y="0"
         id="tspan112">På Bjerget Efterskole tilbyder vi trygge rammer. Her kan livet udfolde sig i et fællesskab, hvor vi har ansvar for hinan-</tspan><tspan
         x="0 5.4990001 10.503 16.002001 18.504 21.257999 27.099001 29.601 32.355 34.856998 42.858002 48.356998 53.855999 58.860001 62.361 65.114998 69.614998 77.615997 83.114998 86.615997 89.370003 94.869003 99.873001 102.627 107.631 113.13 115.884 119.385 124.884 127.386 129.888 135.38699 138.14101 143.64 149.13901 154.638 157.14 159.642 165.14101 167.895 173.394 178.89301 184.392 189.396 192.897 197.397 199.899 203.39999 208.899 211.401 216.89999 222.399 224.901 227.655 235.65601 240.66 246.159 248.91299 253.41299 255.91499 258.66901 261.17099 266.17499 270.67499 275.67899 279.17999 281.93399 287.43301 292.93201 296.43301 301.43701 304.19101 309.19501 314.694 320.19299 323.694 328.698 331.452 334.953 337.45499 342.95401 348.453 350.95499 353.70901 359.54999 362.052 364.806 368.30701 372.80701 378.306 383.80499 388.80899 391.48199 393.98401 396.73801 400.23901 405.73801 408.23999 410.742 413.24399 418.24799 421.74899 424.50299 432.504 438.00299 441.504 444.00601 449.01001 451.76401 457.263 462.76199 465.51599 469.017 474.021 479.02499 482.526 487.53 490.203 492.70499"
         y="12.996"
         id="tspan114">den. Vi lægger vægt på en solid boglig undervisning, men vi laver også andre ting. Vi synger, spiller musik og teater, </tspan><tspan
         x="0 5.4990001 10.503 14.004 16.757999 21.761999 25.263 30.267 35.271 38.771999 41.273998 45.773998 50.778 53.532001 57.033001 62.036999 67.536003 70.038002 72.792 76.292999 81.792 84.293999 86.795998 89.297997 94.302002 97.803001 100.557 105.057 110.556 113.058 115.56 120.564 125.064 130.563 135.567 138.069 140.571 143.073 145.827 151.326 156.33 161.82899 169.83 172.332 177.83099 181.332 186.83099 192.33 195.084 203.08501 205.58701 213.588 216.09 218.84399 221.34599 224.10001 228.60001 234.099 237.60001 242.604 246.105 248.85899 252.36 254.862 260.36099 263.862 267.36301 272.367 274.86899 277.62299 283.12201 287.62201 292.62601 295.38 297.88199 303.38101 306.88199 314.883 318.384 321.88501 327.384 332.388 334.89001 337.392 340.146 346.64401 351.14401 354.64499 359.64899 364.65302 368.15399 370.90799 374.409 377.91 380.41199 382.914 388.41299 391.914 395.41501 398.91599 401.418 403.92001 407.754 410.25601 413.01001 416.51099 421.51501 424.017 426.51901 431.52301 435.02399 437.77802 443.27701 448.28101 452.78101 457.785 462.789 465.29099 470.29501 475.29901 478.05301 483.552 489.05099"
         y="25.992001"
         id="tspan116">har kreative fag, spiller volleyball, badminton m.m. i vores flotte, nye idrætshal. dyrker friluftsliv, sejler havkajak og </tspan><tspan
         x="0 5.0040002 7.506 12.51 16.011 19.511999 24.516001 28.017 30.771 36.27 41.273998 44.028 48.528 54.027 57.528 62.532001 66.032997 68.787003 74.286003 78.786003 83.790001 86.543999 91.547997 94.050003 99.054001 102.555 106.056 111.06 115.56 123.561 129.06 131.562 134.31599 140.157 142.659 145.41299 148.914 153.918 159.41701 164.42101 167.922 170.67599 176.175 181.179 183.933 187.43401 192.438 194.94 198.44099 203.94 207.44099 210.19501 215.694 221.19299 223.94701 226.44901 231.453 235.953 240.957 244.45799 247.21201 255.213 260.71201 264.21301 266.715 270.711 275.715 278.21701 280.71899 283.47299 291.96899 296.97299 302.47198 305.22601 310.23001 315.729 320.733 326.23199 331.73099 336.73499 342.23401 344.73599 347.48999 350.991 353.49301 355.995 358.49701 360.99899 366.49799 369.25201 374.75101 380.25 383.004 385.50601 388.008 392.508 396.009 401.508 404.01001 412.01099 417.51001 422.51401 425.26801 427.76999 430.52399 434.51999 439.52399 445.02301 448.52399 452.02499 457.52399 465.52499 468.27899 473.77802 479.27701 482.77802 487.78201 492.78601 496.28699"
         y="38.987999"
         id="tspan118">klatrer på vores nye klatrevæg. Vi tager på skitur og laver musical. Med åbenhed, tillid og livsglæde i centrum ønsker </tspan><tspan

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text128"><tspan
         x="0 5.4990001 10.998 15.498 19.997999 22.5 27.999001 30.753 35.757 39.257999 42.758999 47.763 51.264 54.764999 59.769001 65.267998 67.769997 72.774002 75.528 78.029999 80.531998 86.030998 91.529999 96.533997 100.035 102.789 110.79 113.292 118.791 122.292 125.046 127.548 130.302 135.80099 140.80499 146.304 149.058 152.55901 157.563 163.062 168.561 174.06 179.064 181.81799 187.317 192.321 195.82201 201.321 204.82201 207.576 213.075 218.07899 220.83299 226.332 231.336 234.83701 237.591 243.09 248.589 252.09 257.58899 262.08899 267.09299 270.59399 274.095 276.59698 279.099 284.59799 289.60199 292.35599 300.85199 306.35101 309.85199 313.353 315.85501 318.60901 324.45001 326.952 329.70599 335.20499 340.20901 343.70999 346.46399 349.965 353.466 358.965 362.466 365.96701 368.46899 373.47299 378.47699 383.97601 388.98001 391.73401 397.233 402.73199 406.233 408.73499 414.23401 417.73499 422.73901 425.41199 427.914 430.668 435.672 441.17099 446.17499 451.67401 454.42801 457.92899 461.42999 464.931 469.935 475.43399 480.93301"
         y="0"
         id="tspan116">rovvig Efterskole ligger midt i den skønne natur på det nordvestlige Mors. Vi har storslåede udsigter, egen strand </tspan><tspan
         x="0 8.0010004 13.005 18.504 21.257999 26.757 31.761 37.259998 42.264 47.763 51.264 56.763 59.516998 65.015999 70.514999 73.268997 81.269997 86.274002 89.775002 93.276001 98.279999 101.781 104.535 109.539 113.04 115.794 119.295 124.299 129.798 134.298 137.052 142.55099 148.05 150.804 155.808 159.30901 164.313 167.814 170.31599 173.07001 178.07401 181.575 184.32899 189.33299 192.834 195.588 201.08701 206.091 208.845 214.34399 219.843 224.343 228.843 231.345 236.84399 239.59801 244.60201 248.103 251.604 256.608 260.10901 263.60999 268.61401 274.11301 276.61499 281.61899 284.37299 289.37701 292.87799 295.63199 300.63599 304.13699 306.89099 311.89499 315.396 318.14999 326.151 331.155 336.65399 339.40799 347.409 352.41299 355.914 359.41501 364.41901 367.92001 370.67401 375.67801 379.17899 381.93301 387.43201 392.931 396.43201 401.931 405.43201 410.931 414.43201 416.93399 422.43301 427.93201 430.686 436.185 441.68399 444.43799 449.44199 453.43799 456.939 459.44101 464.94 470.439 472.94101"
         y="12.996"
         id="tspan118">med badebro og masser af skov og krat. Et år på rovvig Efterskole er et år med masser af udfordring og action. </tspan><tspan
         x="0 6.4980001 11.997 14.751 20.25 25.749001 29.25 32.004002 37.502998 42.507 45.261002 50.264999 53.262001 58.265999 61.263 64.764 69.767998 75.266998 80.765999 84.266998 88.766998 96.767998 100.269 105.273 107.775 111.276 116.28 119.034 122.535 127.539 135.53999 143.541 148.545 154.04401 156.798 164.799 169.80299 175.302 178.056 183.06 188.064 196.065 204.06599 209.07001 212.571 217.575 221.076 226.08 228.75301 231.255 234.009 237.50999 243.009 251.00999 253.76401 259.263 264.76199 268.263 273.267 276.021 281.02499 284.526 287.28 289.78201 295.28101 298.78201 303.78601 307.28699 312.29099 315.79199 319.293 324.297 327.798 332.802 338.30099 343.30499 346.05899 348.561 351.315 356.319 359.82001 362.57401 367.578 370.07999 372.582 377.586 381.08701 383.841 387.34201 389.84399 394.84799 398.349 403.353 406.10699 411.11099 414.612 417.366 420.867 425.871 431.37 433.87201 438.87601 444.375 447.87601 450.63 455.634 458.388 462.888 467.892 471.39301 476.892 481.896 487.39499 490.896 493.89301"
         y="25.992001"
         id="tspan120">du bor på 2-3-sengsværelse sammen med kammerater, som også er interesserede i et eller flere af skolens 5 verdens- </tspan><tspan
         x="0 5.4990001 8.0010004 13.5 17.000999 22.5 27.504 31.004999 33.507 36.261002 44.262001 49.265999 54.764999 57.519001 63.018002 68.516998 71.271004 76.769997 81.774002 85.275002 88.776001 92.277 97.776001 103.275 108.774 116.775 119.277 121.779 124.533 128.034 133.03799 138.537 144.036 146.78999 152.289 157.78799 160.54201 168.543 174.04201 177.543 180.045 185.049 187.55099 190.30499 195.30901 198.81 203.814 208.81799 212.319 214.821 219.321 221.823 225.32401 230.328 233.82899 236.58299 242.082 247.58099 250.33501 255.834 260.83801 264.33899 266.841 272.34 277.83899 280.341 283.095 288.59399 293.59799 297.099 302.59799 306.099 308.853 314.35199 319.85101 322.60501 326.10599 329.60699 332.10901 334.61099 340.10999 343.61099 347.112 350.61301 353.11499 355.617 359.45099 361.953 364.707 369.207 374.211 379.70999 385.20901 388.70999 394.20901 399.70801 403.20901 406.70999 409.46399 414.96301 420.46201 423.216 426.71701 431.72101 434.22299 436.72501 441.729 447.228 450.729 453.23099 455.98499 460.48499 465.48901 470.98801 473.48999 478.49399 483.99301"
         y="38.987999"
         id="tspan122">hjørner: mad og gastronomi, sang og musik, kreativitet og design, natur og friluftsliv, vandsport og sejlads. skolen </tspan><tspan
         x="0 5.4990001 10.503 14.004 16.757999 22.257 27.261 32.759998 37.764 40.518002 44.019001 49.518002 53.019001 56.52 59.516998 62.271 67.769997 73.268997 76.023003 81.027 86.030998 88.532997 93.537003 98.541 104.04 109.539 113.04 116.541 121.041 123.714 126.216 128.97 132.47099 137.97 145.97099 148.72501 154.224 157.72501 163.224 168.72301 173.72701 177.228 179.98199 183.483 185.985 188.487 191.98801 195.489 197.991 203.49001 206.991 209.745 214.245 216.99899 222.498 227.99699 231.498 236.502 239.256 241.758 244.51199 248.013 251.51401 254.01601 257.517 260.01901 265.51801 270.522 276.021 278.77499 281.27701 283.77899 286.28101 289.035 294.87601 297.37799 300.13199 305.63101 308.133 316.134 321.633 326.63699 330.138 332.892 338.39099 341.892 344.646 348.147 350.64899 353.151 355.905 360.909 364.41 367.164 370.66501 375.66901 378.423 383.922 386.42401 391.923 395.42401 398.17801 403.677 409.17599 413.67599 418.17599 420.67801 426.177 428.931 433.935 437.436 440.93701 445.94101 449.44199 452.94299 457.94699 463.44601 465.948 470.952 473.70599 478.20599"
         y="51.984001"
         id="tspan124">har både surf- og kajakudstyr, som bruges flittigt – også i fritiden ... Vi glæder os til at se dig! rovvig Efterskole – </tspan><tspan
         x="0 3.5009999 8.5050001 14.004 16.506001 21.51 27.009001 29.763 37.764 42.768002 48.266998 51.021 56.025002 58.778999 63.278999 68.282997 71.783997 77.282997 82.287003 87.786003 91.287003 96.786003 99.288002 104.787 108.288 113.787 118.791 121.464"
         y="64.980003"
         id="tspan126">skolen med 5 verdenshjørner.</tspan></text>

         x="0 4.5 7.0019999 12.501 16.002001 19.503 22.004999 27.504 33.002998 37.502998 43.001999 45.504002 51.002998 53.757 58.761002 62.262001 65.015999 70.019997 75.518997 78.273003 83.277 85.778999 93.779999 98.783997 104.283 109.782 114.786 120.285 125.784 130.78799 136.287 141.786 146.78999 149.54401 154.548 158.049 161.55 166.554 170.05499 173.556 178.56 184.05901 186.561 191.565 194.319 197.82001 203.319 206.82001 209.57401 215.073 220.57201 224.073 232.07401 237.078 239.58 243.08099 248.58 253.584 259.08301 264.08701 268.58701 273.591 279.09 284.09399 286.84799 291.85199 294.354 299.358 303.858 308.862 312.36301 315.117 323.11801 328.12201 333.621 336.375 339.87601 345.375 350.379 354.375 356.87701 360.37799 362.88 367.884 372.888 377.892 380.646 383.14801 391.14899 394.64999 399.65399 402.651 405.405 410.90399 416.40302 419.15701 422.65799 426.159 431.16299 435.66299 440.66699 445.16699 450.17099 455.67001 459.17099 464.17499 469.17899 471.681 474.18301 479.68201 485.181 490.185"
         y="0"
         id="tspan142">sjørringvold er en almendannende efterskole for normaltbegavede elever med specifikke læse- og stavevanskelighe-</tspan><tspan
         x="0 5.4990001 10.503 13.176 15.678 18.431999 23.931 28.431 33.93 37.431 40.185001 44.685001 47.187 49.941002 52.443001 60.444 65.943001 71.442001 76.445999 79.946999 82.700996 87.200996 95.202003 100.701 104.202 106.956 112.455 117.459 120.213 124.209 129.70799 137.709 143.20799 148.707 152.20799 157.21201 160.713 166.21201 171.216 174.717 179.72099 183.222 188.226 191.72701 194.481 199.98 202.48199 210.483 212.985 218.48399 220.98599 223.74001 229.58099 232.08299 234.83701 238.338 243.342 248.841 253.845 257.34601 260.10001 265.599 271.09799 276.59698 281.60101 287.10001 292.599 296.10001 301.599 307.09799 312.59698 317.60101 321.10199 323.85599 326.358 329.112 334.116 336.61801 341.62201 346.12201 351.12601 354.62701 360.12601 365.13 367.884 373.383 378.88199 381.63599 386.64001 390.14099 392.89499 398.39401 403.39801 406.89899 410.39999 415.89899 419.39999 422.15399 427.65302 431.15399 436.65302 441.15302 446.15701 449.65799 453.159 455.66101 458.16299 460.91699 468.918 473.922 479.42099 482.17499 487.67401 492.67801 496.17899"
         y="12.996"
         id="tspan144">der, hvor vi lægger vægt på computerbaseret hjælp. Vi tager udgangspunkt i eleverne og er derfor prøvefri, men har </tspan><tspan
         x="0 5.4990001 10.503 16.002001 21.500999 26.000999 34.001999 37.502998 42.507 46.007999 49.508999 54.513 60.012001 62.765999 68.264999 73.268997 76.023003 81.522003 87.021004 89.523003 94.527 98.028 103.032 105.786 111.285 113.787 118.287 123.291 128.295 133.79401 136.548 142.047 147.54601 150.3 155.304 160.308 163.80901 167.31 170.811 175.815 178.569 183.573 189.07201 197.073 202.57201 207.576 211.077 216.08099 221.58 225.576 230.58 236.07899 241.578 247.077 252.08099 255.582 260.082 262.58401 266.08499 271.58401 274.086 279.58499 285.08401 287.83801 291.33899 293.841 296.34299 299.09698 302.59799 307.60199 312.60599 318.10501 320.60699 324.108 329.112 331.866 335.367 340.371 345.87 348.37201 353.37601 355.87799 358.63199 364.47299 366.97501 369.729 375.228 380.23199 385.73099 390.23099 393.73199 397.233 402.237 405.73801 408.492 413.496 418.995 423.495 426.996 429.75 435.24899 440.25299 443.754 446.25601 451.755 457.254 462.258 464.76001 470.259 475.263 478.76401 483.76801"
         y="25.992001"
         id="tspan146">håndværksfag på højere niveau og ekstra kompetenceundervisning til teknisk skole. Vi benytter thys nationalpark </tspan><tspan
         x="0 8.0010004 13.005 18.504 21.257999 24.759001 29.763 35.262001 39.096001 41.598 44.352001 47.853001 53.352001 55.854 58.608002 61.110001 66.113998 71.612999 77.112 79.865997 85.364998 90.863998 93.617996 97.119003 100.62 104.121 109.125 114.624 120.123 122.877 126.378 128.88 131.382 134.136 137.63699 141.138 143.64 146.142 151.64101 155.142 158.64301 162.144 164.646 167.14799 170.98199 173.48399 176.23801 179.739 185.23801 188.739 192.24001 194.742 200.241 205.74001 208.242 210.996 213.498 218.502 224.00101 227.502 230.004 232.758 236.259 238.761 242.26199 247.26601 252.27 255.771 258.27301 261.02701 266.526 272.02499 274.77899 278.28 283.77899 286.28101 288.78299 293.78699 297.28799 302.78699 305.289 307.79099 310.293 313.047 317.547 322.55099 330.552 338.55301 343.55701 349.056 351.81 359.811 364.815 370.314 373.06799 378.56699 384.06601 389.07001 394.07401 397.57501 401.07599 406.07999 411.57901 415.07999 418.58099 423.58499 426.08701 428.58899 431.34299 433.845 439.34399 442.845 450.84601 454.34698 457.10101 462.60001 468.099 470.853 478.854 484.353 487.854 490.35599 495.35999"
         y="38.987999"
         id="tspan148">med skov, sø, land og strand til friluftsliv, surfing, jagt, fiskeri og rollespil. sammen med gokartkørsel, idræt og musik </tspan><tspan
         x="0 5.4990001 10.998 13.752 21.753 26.757 32.256001 37.259998 40.761002 43.514999 48.519001 54.018002 59.516998 64.521004 68.022003 70.776001 76.275002 81.278999 84.779999 87.533997 92.033997 94.536003 97.290001 100.791 105.795 108.297 113.301 118.8 123.804 127.305 130.05901 135.063 140.562 143.31599 148.815 152.31599 157.32001 162.819 165.573 170.073 172.575 176.076 179.577 184.58099 187.33501 192.339 195.84 198.59399 206.595 212.09399 214.59599 217.09801 222.597 228.09599 233.10001 238.599 243.603 246.276"
         y="51.984001"
         id="tspan150">og meget andet har vi således en bred vifte af muligheder.</tspan></text>
